import {Validator} from "../base";
import {ILoginParams} from "@entities/user";
import {ValidatorData} from "@shared/lib/validator/models";

type LoginValidatorData = ILoginParams & ValidatorData;

class LoginValidator extends Validator {
    params: Partial<LoginValidatorData> = {};

    validate(data: LoginValidatorData): Partial<LoginValidatorData> {
        return super.validate({
            username: super.required(data.username),
            password: super.required(data.password)
        });
    }
}

export const loginValidator = new LoginValidator();
